import React, { useState, useEffect } from "react";

function Mbg() {
  const [gyms, setGyms] = useState([]);

  useEffect(() => {
    fetch("http://127.0.0.1:5555/gyms")
      .then(response => response.json())
      .then(data => setGyms(data));
  }, []);

  return (
    <>
      <h1>Gyms</h1>
      <ul>
        {gyms.map(gym => (
          <li key={gym.id}>
            <h4>{gym.city}</h4>
            <p>{gym.address}</p>
            <p>{gym.phone}</p>
            <p>{}gym.memberships</p>
          </li>
        ))}
      </ul>
    </>
  );
}

export default Mbg;
